None of the extant, would-be complete, &quot;Calvin and Hobbes&quot; torrents are quite up to snuff, as far as I'm concerned, so here's yet another version. This one ought to have, to the very best of my ability to discern and ensure,

- NO missing pages,
- NO duplicate pages,
- and NO pages out of chronological order.

Specs are in the title - no need to repeat them here, I should think. Included is a 3-page sample for those who would like to compare the quality of this torrent to that of an alternate version before downloading the remainder.

